import React from "react";

class AnotherHome extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="mt-5 me-auto">
                <h2>Лабораторная работа № 8 по РПО</h2>

                <div className="mt-15 me-auto">
                    <p>Reactive</p>
                </div>
            </div>
        )
    }
}

export default AnotherHome;
